import './App.css';

function App() {
  return (
    <div className="App">
      <div className="side-bar flex-column-start-center">
        side
      </div>
      <div className="main-content">
        <div className="header">
          <div className="header-content flex-column">
            header
          </div>
        </div>
        <div className="body flex-column-center">Body</div>
        <div className="footer flex-column-center">Footer</div>
      </div>
    </div>
  );
}

export default App;
